window.bookSummaryJSON = "<p>The perfect blend of <i>Back to the Future</i> and <i>The Shawshank Redemption</i>.</p> <p>Gerald Holstrom is serving his life sentence trying not to think of the crime that led him to 47 years inside. His hands hurt, his back aches, he waits to die.&nbsp;</p> <p>Death comes swiftly at the end of a sharp piece of metal.&nbsp;</p> <p>Gerald fades, his regrets flood him. He wishes only to see the sky without barbed wire blocking his vision.&nbsp;</p> <p>He fades out....</p> <p>Then back in.&nbsp;</p> <p>The sky is clear, his hands don’t shake, his body doesn’t ache.&nbsp;</p> <p>He’s 19 again, is his future set? His Journey is just beginning!</p> <p>KJ Nelson’s fast-paced debut novel <i>Relive</i> is the first in the Journeyer Series.&nbsp;</p> <p>Download <i>Relive</i> today?</p>"; 
